window.bookSummaryJSON = "<p><b>In the Land of Thune, adventure awaits...</b></p> <p>Billy the Barbarian is an Isekai adventure story about a normal man from our Earth whose destiny changes when he gets snatched up by the gods of a magical world. He then wakes up to find himself in a strange, cruel land known as Thune to the locals. It turns out the gods of Thune have pretty big plans for Billy, and before he knows it he's swept up into an adventure the likes of which you've never seen before.</p> <p>Along the way, Billy absorbs cores that enhance his powers, defeats other gods, and develops quite the following of romantically devoted heroines—all powerful warriors in their own right. This is a tale of love, adventure, loss, and triumph in primitive world.</p>"; 
